import React from 'react';

export default class HedM extends React.Component {
  render() {
    return (
      <div className='hedm'>
        <div className='hedm2'>
          <div className='hedm-h1'>
            <h1>TREALOP</h1>
          </div>
        </div>
        <div className='hedm-ul'></div>
      </div>
    );
  }
}
